import '.';
import Nav from './Nav';
import Banner from './Banner';

function App() {

  return (
    <Router>
      <Nav />
      <Route exact path='/' component={Banner} />
      <Route exact path='/about' component={About} />
      <Route exact path='/portfolio' component={Portfolio} />
  </Router>
  );
}

export default App;
